// tool/prompt.ts
function registerCollectionPromptTool(server, gestell) {
  server.tool("promptCollection", "Perform search based reasoning on a collection, and have the Gestell agent respond to a prompt", GestellPromptSchema, async ({
    collectionId,
    categoryId,
    prompt,
    method,
    type,
    vectorDepth,
    nodeDepth,
    maxQueries,
    maxResults,
    template,
    cot,
    messages
  }) => {
    const response = await gestell.query.prompt({
      collectionId,
      categoryId,
      prompt,
      method,
      type,
      vectorDepth,
      nodeDepth,
      maxQueries,
      maxResults,
      template,
      cot,
      messages
    });
    const stream = response.getReader();
    let text = "";
    while (true) {
      const { done, value } = await stream.read();
      if (done)
        break;
      text += value;
    }
    return {
      content: [
        {
          type: "text",
          text: JSON.stringify(text)
        }
      ]
    };
  });
}

